import React from 'react';
import {
    Button, Container, CssBaseline, Grid, Typography, 
} from '@material-ui/core';
import { 
    BrowserRouter as Router, Switch, Route, Link as RouterLink 
} from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
    root: {
        backgroundImage: `url(../img/banner-lg.jpg)`,
        color: theme.palette.common.white,
        position: 'relative',
        display: 'flex',
        alignItems: 'center',
        [theme.breakpoints.up('sm')]: {
          height: '80vh',
          minHeight: 500,
          maxHeight: 1300,
        },
      },
      container: {
        marginTop: theme.spacing(3),
        marginBottom: theme.spacing(14),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      },
}));

const RefLink = React.forwardRef((props, ref) => <RouterLink innerRef={ref} {...props} />);

export default function ProductHero() {
    const classes = useStyles();

    return (
        <React.Fragment>
            <CssBaseline />

            {/* Hero unit */}
            <section className={classes.root}>
                <Container maxWidth="sm" className={classes.container}>
                    <Typography component="h1" align="center" variant="h2" color="textPrimary" gutterBottom>
                        Header 1
                    </Typography>
                    <Typography variant="h5" align="center" color="textSecondary" paragraph>
                        Something short and leading about the application.
                    </Typography>
                    <div className={classes.heroButtons}>
                        <Grid container justify="center">
                            <Grid item>
                                <Button variant="contained" color="primary" component={RefLink} to="/upload">
                                    Get Started
                                </Button>
                            </Grid>
                        </Grid>
                    </div>
                </Container>
            </section>
        </React.Fragment>
    )
}
